This is the version updated in August 2013 of the Siemens Taurus ES64U2 in 21 official liveries/repaints: A1, Audi, DB, Golden Team, Green Mobility, GySEV, GySEV weathered, Hitradio, Kinderdorf, Kyoto Express, Liszt, MAV, OBB, OBB 3P, Rail Cargo Hungary, Railion, Railjet 2P, Railjet 3P, Telekom Austria, Wiener Stadtischen and WLB. 19 are Quick Drive compatible.

Also included are scenarios specifically for the Munich-Augsburg, Hagen-Siegen, Seebergbahn and Testtrak routes (available separately and required to play these scenarios).

See also Railworks 4 HRQ Siemens Taurus ES64U4



Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the Readme.pdf.


